import logo from "./media/logo.png";

function Main({ children }) {
   return <div>{children}</div>;
}

function Box({ children }) {
   return (
      <div className="container relative mb-72 left-1/2 -translate-x-1/2">
         {children}
      </div>
   );
}

function ShowLogo() {
   return (
      <img
         src={logo}
         alt="Angi plays cello logo"
         width={200}
         height="auto"
         className="md:w-1/6"
      />
   );
}

function NavBar() {
   const [isOpen, setIsOpen] = useState(false);
   const genericHamburgerLine = `h-1 w-6 my-1 rounded-full bg-black transition ease transform duration-300`;
   return (
      <nav className="">
         <div className="flex justify-center mb-5">
            <ShowLogo />

            {/* <h1 className="hidden md:flex space-x-8 items-center text-4xl">
              Gina Z Photography
           </h1> */}
         </div>
         <div className="flex justify-around items-center">
            {/* xs and small nav */}
            <button
               className="flex flex-col h-12 w-12 border-2 border-black rounded justify-center items-center group md:hidden m-2"
               onClick={() => setIsOpen(!isOpen)}
            >
               <div
                  className={`${genericHamburgerLine} ${
                     isOpen
                        ? "rotate-45 translate-y-3 opacity-50 group-hover:opacity-100"
                        : "opacity-50 group-hover:opacity-100"
                  }`}
               />
               <div
                  className={`${genericHamburgerLine} ${
                     isOpen ? "opacity-0" : "opacity-50 group-hover:opacity-100"
                  }`}
               />
               <div
                  className={`${genericHamburgerLine} ${
                     isOpen
                        ? "-rotate-45 -translate-y-3 opacity-50 group-hover:opacity-100"
                        : "opacity-50 group-hover:opacity-100"
                  }`}
               />
            </button>
            {isOpen && (
               <>
                  <ul className="flex items-center gap-3 md:hidden">
                     <li>
                        <a href="#services" onClick={() => setIsOpen(!isOpen)}>
                           Services
                        </a>
                     </li>
                     <li>
                        <a href="#portfolio" onClick={() => setIsOpen(!isOpen)}>
                           Portfolio
                        </a>
                     </li>
                     <li>
                        <a href="#contact" onClick={() => setIsOpen(!isOpen)}>
                           Contact
                        </a>
                     </li>
                     <li>
                        <a href="#about" onClick={() => setIsOpen(!isOpen)}>
                           About
                        </a>
                     </li>
                     {/* <li>
                       <a href="#blog" onClick={() => setIsOpen(!isOpen)}>
                          Blog
                       </a>
                    </li>
                    <li>
                       <a href="#reviews" onClick={() => setIsOpen(!isOpen)}>
                          Reviews
                       </a>
                    </li> */}
                  </ul>
               </>
            )}
            {/* md and large nav */}
            <ul className="hidden text-xl md:flex space-x-8">
               <li className="hover:bg-white hover:text-black hover:px-2 hover:font-bold">
                  <a href="#services">Services</a>
               </li>
               <li className="hover:bg-white hover:text-black hover:px-2 hover:font-bold">
                  <a href="#portfolio">Portfolio</a>
               </li>
               <li className="hover:bg-white hover:text-black hover:px-2 hover:font-bold">
                  <a href="#contact">Contact</a>
               </li>
               <li className="hover:bg-white hover:text-black hover:px-2 hover:font-bold">
                  <a href="#about">About</a>
               </li>
               {/* <li className="hover:bg-white hover:text-black hover:px-2 hover:font-bold">
                 <a href="#blog">Blog</a>
              </li>
              <li className="hover:bg-white hover:text-black hover:px-2 hover:font-bold">
                 <a href="#reviews">Reviews</a>
              </li> */}
            </ul>
         </div>
      </nav>
   );
}

function ScrollToTop() {
   return (
      <div className="flex justify-center items-center">
         <a
            href="#home"
            className="animate-pulse bg-black text-white text-xs md:text-lg lg:text-2xl px-2 py-1 md:mt-3 rounded hover:bg-white hover:text-black"
         >
            Scroll to top
         </a>
      </div>
   );
}

function Home() {
   return <div>Home</div>;
}

export default function App() {
   return (
      <div id="home" className="grid grid-cols-5 gap-3 bg-black font-serif">
         <div className="col-span-5">
            <NavBar />
         </div>
         <div className="col-span-5">
            <Main>
               <Box>
                  <Home />
               </Box>
               <Box>
                  <Portfolio />
                  <ScrollToTop />
               </Box>
               <Box>
                  <Contact />
                  <ScrollToTop />
               </Box>
               <Box>
                  <About />
                  <ScrollToTop />
               </Box>
            </Main>
         </div>
      </div>
   );
}
